function regenerateThumbs(t){$.ajax({url:"/actions/regenerate_thumbs.php",type:"post",data:{videoid:t,origin:"upload_thumb"},dataType:"json",beforeSend:function(){showSpinner()},success:function(t){$("#thumb_list").html(t.template),$(".page-content").prepend(t.msg),hideSpinner()}})}function delete_thumb(t,e){$.ajax({url:"/actions/delete_thumbs.php",type:"post",dataType:"json",data:{videoid:t,num:e}}).done(function(t){$("#thumb_list").html(t.template)}).always(function(t){$(".page-content").prepend(t.msg)})}
